import React from "react";
import { NavLink } from "react-router-dom";
import "./header.css";

const Header = () => {
  const navStyles = ({isActive}) => {
    return {
      color: isActive ? "#8CBCDB" : "#ffffff",
    };
  };

  return (
    <nav className="navbar navbar-expand-md navbar-dark">
      <NavLink className="navbar-brand" to="/">
        Navbar
      </NavLink>
      <button
        className="navbar-toggler"
        type="button"
        data-toggle="collapse"
        data-target="#collapsibleNavbar"
      >
        <span className="navbar-toggler-icon"></span>
      </button>
      <div className="collapse navbar-collapse" id="collapsibleNavbar">
        <ul className="navbar-nav">
          <li className="nav-item">
            <NavLink className="nav-link" id="hover-link" to="/about" style={navStyles}>
              Link
            </NavLink>
          </li>
          <li className="nav-item">
            <NavLink className="nav-link" id="hover-link" to="/projects" style={navStyles}>
              Link
            </NavLink>
          </li>
          <li className="nav-item">
            <NavLink className="nav-link" id="hover-link" to="/services" style={navStyles}>
              Link
            </NavLink>
          </li>
        </ul>
      </div>
    </nav>
  );
};

export default Header;
